import React from 'react';
import Navbar from '../components/Navbar';
import ImageGrid from '../components/ImageGrid';
import './Home.css';

function Home() {
    return (
        <div className="home-wrapper">
            <Navbar />
            <ImageGrid />

            <div className="intro-text">
                <p>도화아파트먼트는 우리의 공간에서<br />매일 아침 커피를 만들고, 디저트를 굽습니다.</p>
                <h2>Build Yours</h2>
                <p>당신은 무엇을 쌓고 싶으세요?</p>
            </div>
        </div>
    );
}

export default Home;
